import Navevent from './Navevent';
import Eventlist from './Eventlist';
import Footer from '../Profile/Footer';

const Event = () => {
    return (
       <>
       <Navevent />
       <Eventlist />
       <Footer />
       </> 
    );
}

export default Event;
